window.bookSummaryJSON = "<p>What kind of man sacrifices his country for his family? But...what kind of man sacrifices his family for his country?</p> <p>President Nathaniel “Dutch” McAdams and his family are swept away on Air Force One when a Black Swan event cripples the rattled American economy. Meant to be a safe-haven, he soon finds the violence in the air just as savage as the chaos on the ground.</p> <p>Dutch is running out of time, and he must choose between his own child or the fate of millions of Americans; most of whom are woefully unprepared and running blind in mass hysteria.</p> <p><i>The Last Air Force One</i> is a post-apocalyptic political thriller, and a companion to <i>Black Autumn</i>. Can be listened to in any order.</p>"; 
